#include <stdio.h>
#include <stdlib.h>
#include <time.h>

int comps, trocas, arraySize;

//Funcao para embaralhar o vetor (adaptação do Fisher–Yates shuffle)
int shuffleArray(int vet[], int n) {
    int i, j, temp, count = 0;
    int size = sizeof(*vet) / sizeof(vet[0]);
    float randomizationFactor = 0.01; //Grau de ordenacao
    double nextDouble;

    srand(time(NULL));

    for (i = 0; i < n; i++) {
        if(vet[i] <= vet[i+1]) {
            count++;
        } 
    }

    count = 0;

    for (i = n - 1; i > 0; i--) {
    nextDouble = (double)rand() / (double)RAND_MAX;
        if (nextDouble < randomizationFactor) {
            j = rand() % n;
            temp = vet[i];
            vet[i] = vet[j];
            vet[j] = temp;
            count++;
        }
    }

    return *vet;
}

//Dropsort original
int dropSort(int *arr, int size, int *sortedArr) {
    int newSize = 1, i;

    comps = trocas = arraySize = 0;

    shuffleArray(arr, size);

    sortedArr[0] = arr[0];
    for (i = 1; i < size; ++i) {
        if (arr[i] >= sortedArr[newSize-1]) {
            comps++;
            trocas++;
            ++newSize;
            sortedArr[newSize-1] = arr[i];
        } else {
            comps++;
        }
    }

    for (i = 0; i < newSize; i++) {
        //printf("%d ", sortedArr[i]);
        arraySize++;
    }

    return arraySize;
}

//Recent Memory
int dropSortRecMem(int *arr, int size, int *sortedArr) {
    int newSize = 1, i, count = 0, j, temp = 0;

    comps = trocas = arraySize = 0;

    shuffleArray(arr, size);

    //printf("\n");

    sortedArr[0] = arr[0];
    for (i = 1; i < size; ++i) {
        if (arr[i] >= sortedArr[newSize-1]) {
            ++newSize;
            sortedArr[newSize-1] = arr[i];
            comps++;
            trocas++;
        } else {
            count++;
            if (count >= 4) {
                sortedArr[newSize-1] = arr[i];
            }
            trocas++;
        }
    }

    for (i = 0; i < newSize; i++) {
        //printf("%d ", sortedArr[i]);
        arraySize++;
    }

    return arraySize;
}

//Double Comparison
int dropSortDoubleComparison(int *arr, int size, int *sortedArr) {
    int newSize = 1, i;

    comps = trocas = arraySize = 0;

    shuffleArray(arr, size);

    //printf("\n");

    sortedArr[0] = arr[0];
    for (i = 1; i < size; ++i) {
        if (arr[i] >= sortedArr[newSize-1] && arr[i] <= arr[i + 1]) {
            comps++;
            trocas++;
            ++newSize;
            sortedArr[newSize-1] = arr[i];
        } else {
            comps++;
        }
    }

    for (i = 0; i < newSize; i++) {
        //printf("%d ", sortedArr[i]);
        arraySize++;
    }

    return arraySize;
}

